import React from "react";
import NavItem from "./nav-item/Nav-item.component";
import "./Navbar.styles.scss";
import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navItems = [
    ["Home", ""],
    ["Resume", ""],
    ["Portfolio", ["Graphic Design", "Drawing", "Painting", "Photography"]],
    ["Contact", ""],
    ["Shop", ""],
  ];
  const navigate = useNavigate();

  return (
    // <div className = 'nav-bar' style = {{display:'flex', justifyContent: 'space-evenly', backgroundColor:'#563d7c'}}>
    //     {navItems.map(ele=><NavItem item = {ele}/>)}

    // </div>
    <div>
      <nav class="navbar navbar-expand-lg bg-light"  style={{backgroundColor: "#563d7c"}} >

        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon" ></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto" style={{width:'100%', justifyContent:'space-evenly'}}>
            <li class="nav-item active">
              <div class="nav-link" href="#" onClick = {()=>navigate('/home')}>
                Home <span class="sr-only">(current)</span>
              </div>
            </li>

            <li class="nav-item dropdown">
              <div
                class="nav-link dropdown-toggle"
                href="#"
                id="navbarDropdown"
                role="button"
                data-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"

              >
                Portfolio
              </div>
              <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                <a class="dropdown-item" href="#">
                  Action
                </a>
                <a class="dropdown-item" href="#">
                  Another action
                </a>
                <div class="dropdown-divider"></div>
                <a class="dropdown-item" href="#">
                  Something else here
                </a>
              </div>
            </li>
            <li class="nav-item active">
              <div class="nav-link" href="#" onClick = {()=>navigate('/Resume')}>
                Resume <span class="sr-only">(current)</span>
              </div>
            </li>
            <li class="nav-item active">
              <div class="nav-link"   href="#" onClick = {()=>navigate('/Shop')}>
                Shop <span class="sr-only">(current)</span>
              </div>
            </li>
            <li class="nav-item active">
              <div class="nav-link"   href="#" onClick = {()=>navigate('/Contact')}>
                Contact <span class="sr-only">(current)</span>
              </div>
            </li>

          </ul>

        </div>
      </nav>
    </div>
  );
};

export default Navbar;

